(183, '{\"id\":\"base3-17\",\"name\":\"Articuno\",\"supertype\":\"Pok\\u00e9mon\",\"subtypes\":[\"Basic\"],\"level\":\"35\",\"hp\":\"70\",\"types\":[\"Water\"],\"attacks\":[{\"name\":\"Freeze Dry\",\"cost\":[\"Water\",\"Water\",\"Water\"],\"convertedEnergyCost\":3,\"damage\":\"30\",\"text\":\"Flip a coin. If heads, the Defending Pok\\u00e9mon is now Paralyzed.\"},{\"name\":\"Blizzard\",\"cost\":[\"Water\",\"Water\",\"Water\",\"Water\"],\"convertedEnergyCost\":4,\"damage\":\"50\",\"text\":\"Flip a coin. If heads, this attack does 10 damage to each of your opponent\'s Benched Pok\\u00e9mon. If tails, this attack does 10 damage to each of your own Benched Pok\\u00e9mon. (Don\'t apply Weakness and Resistance for Benched Pok\\u00e9mon.)\"}],\"resistances\":[{\"type\":\"Fighting\",\"value\":\"-30\"}],\"retreatCost\":[\"Colorless\",\"Colorless\"],\"convertedRetreatCost\":2,\"set\":{\"id\":\"base3\",\"name\":\"Fossil\",\"series\":\"Base\",\"printedTotal\":62,\"total\":62,\"legalities\":{\"unlimited\":\"Legal\"},\"ptcgoCode\":\"FO\",\"releaseDate\":\"1999\\/10\\/10\",\"updatedAt\":\"2020\\/08\\/14 09:35:00\",\"images\":{\"symbol\":\"https:\\/\\/images.pokemontcg.io\\/base3\\/symbol.png\",\"logo\":\"https:\\/\\/images.pokemontcg.io\\/base3\\/logo.png\"}},\"number\":\"17\",\"artist\":\"Mitsuhiro Arita\",\"rarity\":\"Rare\",\"flavorText\":\"A legendary bird Pok\\u00e9mon that is said to appear to doomed people who are lost in icy mountains.\",\"nationalPokedexNumbers\":[144],\"legalities\":{\"unlimited\":\"Legal\"},\"images\":{\"small\":\"https:\\/\\/images.pokemontcg.io\\/base3\\/17.png\",\"large\":\"https:\\/\\/images.pokemontcg.io\\/base3\\/17_hires.png\"},\"tcgplayer\":{\"url\":\"https:\\/\\/prices.pokemontcg.io\\/tcgplayer\\/base3-17\",\"updatedAt\":\"2025\\/04\\/26\",\"prices\":{\"1stEdition\":{\"low\":13,\"mid\":18,\"high\":35,\"market\":19.35,\"directLow\":null},\"unlimited\":{\"low\":3.75,\"mid\":6.39,\"high\":89,\"market\":8.27,\"directLow\":7.5}}},\"cardmarket\":{\"u